      return (
        <p style={{ color: "red" }}>
          Invalid Username OR Password. Please try again.
        </p>
      );
    }
  };

const UserAccountPage = ({ setToken }) => {
  const navigate = useNavigate();

  return (
    <div>
      <Banner />
      <h1>Dashboard</h1>
      <LogoutButton navigate={navigate} setToken={setToken} />
      <h1>User Account</h1>
    </div>
  );
};

export default UserAccountPage;
